import React from "react";
import "./style.css";

const styles = {
  containerStyle: {
    background: "pink",
  },
};

function Title() {
  return (
    <div className="container">
      <div className="jumbotron" style={styles.containerStyle}>
        <h1>Password Generator</h1>
        <p>
          <button className="btn btn-primary btn-lg">Generate Password</button>
        </p>
      </div>
    </div>
  );
}

export default Title;
